import React from 'react';
import styled from 'styled-components';

function NewExpense() {
	return (
		<Wrapper>
			<Container>
				<InputItem>
					<label>Title</label>
					<input type='text' />
				</InputItem>
				<InputItem>
					<label>Amount</label>
					<input type='number' />
				</InputItem>
				<InputItem>
					<label>Date</label>
					<input type='date' />
				</InputItem>
			</Container>
		</Wrapper>
	);
}

export default NewExpense;

const Wrapper = styled.div`
	width: 100%;
	display: flex;
	align-items: center;
	justify-content: center;
`;

const Container = styled.form`
	width: 60%;
	display: flex;
	flex-wrap: wrap;
	justify-content: flex-start;
	align-items: center;
`;

const InputItem = styled.div`
	display: flex;
	flex-direction: column;
	margin: 20px;
	input {
		font-size: 20px;
		width: 400px;
		border-radius: 5px;
		border: none;
		outline: none;
	}
`;
